import React, { useState } from 'react';
import Parse from 'parse';

const Admin = () => {
  const [isAdmin, setIsAdmin] = useState(false);
  const [adminPass, setAdminPass] = useState('');
  const [courseId, setCourseId] = useState('linux');
  const [formData, setFormData] = useState({ instructor: '', zoomLink: '', videoLink: '', schedule: '' });

  const checkPass = () => {
    if (adminPass === "snx_admin_2026") { // á€’á€®á€™á€¾á€¬ Password á€•á€¼á€±á€¬á€„á€ºá€¸á€œá€­á€¯á€·á€›á€á€šá€º
      setIsAdmin(true);
    } else {
      alert("Wrong Admin Password!");
    }
  };

  const handleUpdate = async (e) => {
    e.preventDefault();
    const Course = Parse.Object.extend("Classes");
    const query = new Parse.Query(Course);
    query.equalTo("courseId", courseId);
    try {
      let obj = await query.first();
      if (!obj) {
        obj = new Course();
        obj.set("courseId", courseId);
        const titles = { linux: "Linux Administration", cyber: "Cyber Security", net: "Networking", py_basic: "Python (Basic)", py_adv: "Python (Advanced)", hacking: "Real World Hacking" };
        obj.set("title", titles[courseId]);
      }
      obj.set("instructor", formData.instructor);
      obj.set("zoomLink", formData.zoomLink);
      obj.set("videoLink", formData.videoLink);
      obj.set("schedule", formData.schedule);
      await obj.save();
      alert("Data Pushed Successfully! âœ…");
    } catch (err) { alert(err.message); }
  };

  if (!isAdmin) {
    return (
      <div style={{ backgroundColor: '#0a192f', height: '100vh', display: 'flex', justifyContent: 'center', alignItems: 'center', flexDirection: 'column', color: '#00ff41' }}>
        <h2>ENTER ADMIN ACCESS KEY</h2>
        <input type="password" onChange={(e) => setAdminPass(e.target.value)} style={{ padding: '10px', margin: '10px', background: '#112240', border: '1px solid #00ff41', color: '#fff' }} />
        <button onClick={checkPass} style={{ padding: '10px 20px', background: '#00ff41', border: 'none', cursor: 'pointer' }}>ACCESS</button>
      </div>
    );
  }

  return (
    <div style={{ backgroundColor: '#0a192f', minHeight: '100vh', color: '#00ff41', padding: '50px' }}>
      <h1>ðŸ›  Admin Control Center</h1>
      <form onSubmit={handleUpdate} style={{ display: 'flex', flexDirection: 'column', maxWidth: '500px', gap: '15px', background: '#112240', padding: '25px', borderRadius: '10px' }}>
        <select onChange={(e) => setCourseId(e.target.value)} style={styles.input}>
          <option value="linux">Linux Administration</option>
          <option value="cyber">Cyber Security</option>
          <option value="net">Networking</option>
          <option value="hacking">Real World Hacking</option>
        </select>
        <input type="text" placeholder="Instructor" style={styles.input} onChange={(e)=>setFormData({...formData, instructor: e.target.value})} />
        <input type="text" placeholder="Zoom Link" style={styles.input} onChange={(e)=>setFormData({...formData, zoomLink: e.target.value})} />
        <input type="text" placeholder="YouTube Video ID" style={styles.input} onChange={(e)=>setFormData({...formData, videoLink: e.target.value})} />
        <input type="text" placeholder="Schedule" style={styles.input} onChange={(e)=>setFormData({...formData, schedule: e.target.value})} />
        <button type="submit" style={styles.btn}>UPDATE SYSTEM</button>
      </form>
    </div>
  );
};

const styles = {
  input: { padding: '10px', background: '#0a192f', border: '1px solid #00ff41', color: '#fff' },
  btn: { padding: '15px', background: '#00ff41', color: '#0a192f', fontWeight: 'bold', cursor: 'pointer', border: 'none' }
};

export default Admin;
